import React, { Fragment } from "react";

interface IThumbProps {
  title: string;
  imageSrc: string;
}

const Thumb: React.FC<IThumbProps> = ({ title, imageSrc }) => (
  <Fragment>
    <img src={imageSrc} />
    <h2>{title}</h2>
  </Fragment>
);

export default Thumb;
